Description:
A real estate contract between James A. Irby , Allen Mercer Wilkins and Mary P. Tabbs, the seller. Contains:
- Legal details - the buyers paid in all $2500 for the house, in monthly installments of $50 after the first payment of $500;
- Close up of the final signatures;
- Page beginning a section with specifications for "labor and materials to be used in the construction of a [Lakeland] residence. ...";
- Financial guidelines; Constructional requirements; Excavation and concrete work requirements; Brickwork, carpenter work, and inside trim requirements; Stairway, flooring, lathing and plastering requirements; Hardware, painting, and electric-work requirements; Stairway, doors, lathing and plastering requirements; Hardware, roofing, painting and electric-work requirements; Heating requirements; 
- Final signoff sheet, finished by R. C. Archer Jr. on august 21 1935.

Contains:
- The cover page contains various icons representative of Lakeland, such as the streetcar trolley sign and the railroad crossing;
- The schedule for the weekend, detailing the events for the community party on Saturday and the religious service on Sunday;
- An introductory piece, explaining the mission of the weekend and the Lakeland Community Heritage Project;
- An overview of Lakeland history. Noted image of a house is the "Hicks house;"
- Brief descriptions of Lakeland's churches and Lakeland's clubs.;
- A description of the families of Lakeland and how they were forced out of their homes by Urban Renewal. Contains a description of the history and impact of Lake Artemesia;
- More descripition of the erasure of a large part of the community, then recognition of how it's come back stronger than before;
- A family tree template;
- The order of service for the religious service on the Sunday., Empty space for notes and resources with which one could find their family history. On the right side, a map of eastern Lakeland;
- The final page of the pamphlet, with thank-yous and acknowledgements.

Contains the following:
- First page of the program, with a brief summary of the plot. Written by Beulah Woolard. Bettye Marshall delivers the opening "Graduate Soliloquy.";
- The second page, with the scene in which the act takes place. Also has the cast printed; 
- List of the musicians, then three more roles: Class Bill (?), Prophecy, and Gifts. These are delivered respectively by Beatrice Snowden, Elsie Carter, and Yvonne James & Arthur Dock; 
- Back of the pamphlet, with writing on the top right corner. It may read either "Ho 1054." Hard to tell.

Contains the following:
- The order of service, and an acknowledgement 'In memoriam' of classmates and school faculty who have passed away;
- The itinerary for the weekend, from Friday June 22nd to Sunday June 24th;
- Description of the Edgar A. Smith Scholarship and some of the terms for it;
- "Guide post for the future" - essentially a few mission statements to go by - treating friends with care, trusting in God, passing knowledge onto future generations, and being pious;
- A list of members of the Sterring Committee for this reunion;;
- A short history of Lakeland Jr/Sr High, as well as a photograph of its front entrance. 
- A passage expressing gratitude to the teaching staff of the high school., The left page simply reads: "Celebrating in love ... Reflecting with joy." 
- A short timeline of various years important to the class and the things accomplished by members of the class each year;
- The final page of the brochure - finished of with a short poem looking to the future. At the bottom of the page is a brief thank you to everyone who contributed to the 40th reunion.
- The first page of the brochure - Establishing the times and places of the reunion., The left page has a short timeline of the background and schooling of various members of the class - from the communities they were born in, the elementary schools they attended, to their years at Lakeland Jr/Sr High School. The right page is a letter to classmates from the Steering community, establishing a mission for the future and remembering the bonds of their past. , The left page has a schedule for the night, and the right side has a menu for the dinner served.

- Title page of the brochure for Lakeland Heritage, September 2018. The cover shows the Lakeland Majorettes marching in a parade.
- First and second interior pages of the brochure, opening with a thank you to the attendees of the event and updating them on recent accomplishments and works done by and in partnership with the LCHP. The second page foes further into detail on two major events; "A Path Forward," a mural done by Lakeland teen artists and others on the trail underpass by Baltimore Avenue. The second major event is that of the LCHP establishing the archive project in partnership with MITH and other departments of UMD;
- Third and fourth interior pages of the brochure. The left page details the College Park Dream Team Basketball event at the Community Center. Below, a description of the history of sports in Lakeland, and the introduction of Lakeland Hero Sports Cards. These cards each focus on one athletic Lakelander, with a portrait of them on the front and a history of their events and sports accomplishments on the back. The right page has a dedication to Leonard Smith, the Grand Marshal of the event, and the special guests of the Parade & Picnic
- Fifth and sixth pages of the brochure. The fifth has the itinerary for Sunday's event, Music at the Washington Brazilian SDA Church. On the sixth page are brief biographies of the performers listed;
- The final page of the booklet, with a last schedule of the events of the weekend. There is also a thank you to sponsors and partners of the event.
